DROP TABLE IF EXISTS `pt_param`;
CREATE TABLE `pt_param` (
  `ids` varchar(32) NOT NULL,
  `version` bigint(20) DEFAULT NULL,
  `description` varchar(200) DEFAULT NULL,
  `images` varchar(50) DEFAULT NULL,
  `names` varchar(25) DEFAULT NULL,
  `orderids` bigint(20) DEFAULT NULL,
  `paths` varchar(1000) DEFAULT NULL,
  `zhuangtai` char(1) DEFAULT NULL,
  `parentids` varchar(32) DEFAULT NULL,
  `isparent` varchar(5) DEFAULT NULL,
  `levels` bigint(20) DEFAULT NULL,
  `numbers` varchar(50) DEFAULT NULL,
  `val` varchar(500) DEFAULT NULL,
  `i18n` char(1) DEFAULT NULL COMMENT '是否国际化',
  `val_zhcn` varchar(500) DEFAULT NULL,
  `val_zhhk` varchar(500) DEFAULT NULL,
  `val_zhtw` varchar(500) DEFAULT NULL,
  `val_ja` varchar(500) DEFAULT NULL,
  `val_enus` varchar(500) DEFAULT NULL,
  `status` char(1) DEFAULT NULL,
  PRIMARY KEY (`ids`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='参数';

